INSERT INTO `article` VALUES (1, '# 认识 Flex 布局\n\nFlex 是 Flexible Box 的缩写，意为“弹性布局”，用来为盒状模型提供最大的灵活性。\n\n任何一个元素都可以指定为 Flex 布局。\n\n行内元素使用 Flex 布局的方式为： `display: inline-flex;`\n\nFlex 主要用于管理**容器**和**子元素**之间的位置关系。\n\n容器默认存在两个轴：水平的**主轴**和垂直的**交叉轴**，子元素默认沿主轴排列。\n\n> 设为Flex布局以后，子元素的float、clear和vertical-align属性将失效。\n\n## 一、容器的属性\n\n> 以下列举的第一个候选值均为默认值。\n\n### 1、flex-direction 属性\n\n用以决定主轴的方向，即子元素的排列方向，它有四个候选值：\n\n- row：水平，起点在左端。\n- row-reverse：水平，起点在右端。\n- column：垂直，起点在上沿。\n- column-reverse：垂直，起点在下沿。\n\n### 2、flex-wrap 属性\n\n当子元素在一条轴线上排不下时，控制换行方式。\n\n- nowrap：不换号。\n- wrap：换行，第一行在上方。\n- wrap-reverse：换行，第一行在下方。\n\n### 3、flex-flow 属性\n\n是`flex-direction`和`flex-wrap`的简写形式。\n\n```css\nflex-flow: <flex-direction> <flex-wrap>;\n```\n\n### 4、justify-content 属性\n\n定义了子元素在主轴上的对齐方式。\n\n- flex-start:左对齐。\n- flex-end：右对齐。\n- center：居中。\n- space-between：两端对齐，项目之间的间隔都相等。\n- space-around：每个项目两侧的间隔相等。因此导致项目之间的间隔比项目与边框的间隔大一倍。\n\n![](http://www.runoob.com/wp-content/uploads/2015/07/c55dfe8e3422458b50e985552ef13ba5.png)\n\n### 5、align-items 属性\n\n- stretch：如果项目未设置高度或设为 auto，将占满整个容器的高度。\n- flex-start：交叉轴的起点对齐。\n- flex-end：交叉轴的终点对齐。\n- center：交叉轴的中点对齐。\n- basseline：项目的第一行文字的基线对齐。\n\n![](http://www.runoob.com/wp-content/uploads/2015/07/2b0c39c7e7a80d5a784c8c2ca63cde17.png)\n\n### 6、align-content 属性\n\n- flex-start：与交叉轴的起点对齐。\n- flex-end：与交叉轴的终点对齐。\n- center：与交叉轴的中点对齐。\n- space-between：与交叉轴两端对齐，轴线之间的间隔平均分布。\n- space-around：每根轴线两侧的间隔都相等。所以，轴线之间的间隔比轴线与边框的间隔大一倍。\n- stretch（默认值）：轴线占满整个交叉轴。\n\n![](http://www.runoob.com/wp-content/uploads/2015/07/f10918ccb8a13247c9d47715a2bd2c33.png)\n\n## 二、子元素（项目）的属性\n\n### 1、order 属性\n\n定义项目的排列顺序，数值越小，排列越靠前，默认为0.\n\n```css\norder: <integer>;\n```\n\n### 2、flex-grow 属性\n\n定义项目的放大比例，默认为0，即如果存在剩余空间也不放大。\n\n```css\nflex-grow: <number>; /* default 0 */\n```\n\n> 如果所有项目的flex-grow属性都为1，则它们将等分剩余空间（如果有的话）。如果一个项目的flex-grow属性为2，其他项目都为1，则前者占据的剩余空间将比其他项多一倍。\n\n### 3、flex-shrink 属性\n\nflex-shrink属性定义了项目的缩小比例，默认为1，即如果空间不足，该项目将缩小。\n\n> 如果所有项目的flex-shrink属性都为1，当空间不足时，都将等比例缩小。如果一个项目的flex-shrink属性为0，其他项目都为1，则空间不足时，前者不缩小。\n\n### 4、flex-basis 属性\n\n定义了在分配多余空间之前，项目占据的主轴空间（main size）。浏览器根据这个属性，计算主轴是否有多余空间。它的默认值为auto，即项目的本来大小。\n\n> 它可以设为跟width或height属性一样的值（比如350px），则项目将占据固定空间\n\n### 5、flex 属性\n\n是`flex-grow`, `flex-shrink` 和 `flex-basis`的简写，默认值为`0 1 auto`。后两个属性可选。\n\n```css\nflex: none | [ <\'flex-grow\'> <\'flex-shrink\'>? || <\'flex-basis\'> ]\n```\n\n> 该属性有两个快捷值：auto (1 1 auto) 和 none (0 0 auto)。\n>\n> 建议优先使用这个属性，而不是单独写三个分离的属性，因为浏览器会推算相关值。\n\n### 6、align-self 属性\n\n允许单个项目有与其他项目不一样的对齐方式，可覆盖align-items属性。默认值为auto，表示继承父元素的align-items属性，如果没有父元素，则等同于stretch。\n\n## 三、使用问题\n\n#### 在容器中使用`position:fixed`会导致 flex 布局失效\n\n解决办法：\n\n在容器外面套一个`<div>`并使其具有`position:fixed`属性。', 0, 'Flex布局是最近几年才出现的布局方式，它灵活的布局方式使得构建一个自适应网页变得十分简单。', 'Flex', 0, '2019-04-23 13:30:05', 30, 3001, NULL);
